import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { InfectionPulmonaire } from 'src/app/models/InfectionPulmonaire';
import { PulmonaireService } from 'src/app/services/pulmonaire.service';
Router
@Component({
  selector: 'app-pulmonaire',
  templateUrl: './pulmonaire.component.html',
  styleUrls: ['./pulmonaire.component.css']
})
export class PulmonaireComponent {
  complications: InfectionPulmonaire[] = [new InfectionPulmonaire()];
  errorMessage: string = '';
  patientId: string | null = null;

  constructor(private PulmonaireService: PulmonaireService,private router:Router) {}
  ngOnInit(): void {
    // Retrieve the PatientId from local storage
    this.patientId = localStorage.getItem('patientId');
  
    if (this.patientId && this.patientId !== '0') {
      console.log('Patient ID retrieved from local storage:', this.patientId);
    } else {
      console.error('No valid Patient ID found in local storage.');
    }
  }
  addComplication() {
    this.complications.push(new InfectionPulmonaire());
  }

  onSubmit() {
    let successfulSubmission = 0; // Counter to track successful submissions

    this.complications.forEach(complication => {
      complication.PatientId = parseInt(this.patientId!, 10);

      if (isNaN(complication.PatientId)) {
        console.error('Invalid patientId:', this.patientId);
        return; // Stop submission if patientId is invalid
      }
      this.PulmonaireService.addpul(complication).subscribe(
        response => {
          console.log('Complication added successfully', response);
          successfulSubmission++;
          this.errorMessage = '';

          // Navigate to the next page with the patientId after all submissions are successful
          if (successfulSubmission === this.complications.length) {
            if (this.patientId) {
              this.router.navigate(['admin/men', this.patientId]).then(() => {
                console.log('Navigated to the next page with patientId:', this.patientId);
              }).catch(err => {
                console.error('Navigation error:', err);
              });
            } else {
              console.error('No patientId found. Navigation aborted.');
            }
          }
        },
        (error: HttpErrorResponse) => {
          console.error('Error adding Complication', error);
          this.errorMessage = error.error.title;
          if (error.error.errors) {
            for (const [field, errors] of Object.entries(error.error.errors)) {
              console.error(`Validation error for ${field}:`, errors);
            }
          }
        }
      );
    });
  }
}
